import { Card, CardHeader, IconButton, Table, TableCell, TableContainer, TableHead, TableRow } from '@mui/material'
import React, { useState } from 'react'

export default function Category() {
  const [openCreateCategory, setOpenCreateCategory] = useState(false);

  const handleOpenChangeCategory = () => 
    setOpenCreateCategory(!openCreateCategory);

  return (
    <Card className='mt-1'>
      <CardHeader
        title={"Categories"}
        sx={{
          pt: 2, 
          alignItems: "center", 
          "& .MuiCardHeader-action": { mt: 0.6},
        }}
        action={
          <IconButton onClick={handleOpenChangeCategory}/>
        }
      />
      <TableContainer>
        <Table sx={{}} aria-label= "table in dashboard">
          <TableHead>
            <TableRow>
              <TableCell>
                id
              </TableCell>
            </TableRow>
          </TableHead>
        </Table>
      </TableContainer>
    </Card>
  )
}
